    "2013-03-15T10:59:16.655130",nt"name": "casa-grande-ruins-national-monument-vegetation-mapping-project-spatial-vegetation-data",nt"isopen":
    false,nt"url": null,nt"notes": "This feature class contains complete polygonal
    coverage (map units) for two management units of Casa Grande Ruins NM. Each polygon
    has been attributed with either Alliance or Association level vegetation community
    names. Polygons were drafted using heads-up digitzing methods in ESRI ArcMap software
    using Quickbird satellite data as a guide and were subsequently field verified for
    accuracy. Field verification and species level attribution occured during March
    2008. Edits to polygon boundaries and attribution were done using ESRI ArcMap software
    at the Sonoran Desert Network office. Polygons were verified and validated using
    standard ArcGIS topolgy rules.",nt"license_title": null,nt"extras": [{ntt"key":
